INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 102301, 401, "アヤネ", 24, 0.0, 2, 2, 24001, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, "2030/12/17 14:59:59", 0.0, 2.21, 102301, 402, "アヤネ", 24, 0.0, 1, 2, 24002, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 102301, 403, "アヤネ", 24, 0.0, 2, 2, 24003, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, "2030/12/17 14:59:59", 0.0, 1.99, 192201, 701, "アサヒ", 24, 0.0, 2, 1, 24004, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, "2030/12/17 14:59:59", 0.0, 2.21, 192201, 702, "アサヒ", 24, 0.0, 1, 2, 24005, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, "2030/12/17 14:59:59", 0.0, 3.33, 192201, 703, "アサヒ", 24, 0.0, 2, 1, 24006, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 192301, 801, "部員３", 24, 0.0, 2, 2, 24007, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, "2030/12/17 14:59:59", 0.0, 2.68, 192301, 802, "部員３", 24, 0.0, 1, 2, 24008, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 192301, 803, "部員３", 24, 0.0, 2, 2, 24009, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("やった！", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 192501, 501, "", 24, 0.0, 1, 1, 24010, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("勝ったよ！", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 192501, 502, "", 24, 0.0, 1, 1, 24011, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("いい調子！", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 192501, 503, "", 24, 0.0, 1, 1, 24012, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, "2030/12/17 14:59:59", 0.0, 5.33, 113501, 111, "ミサト", 24, 0.0, 6, 2, 24013, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, "2030/12/17 14:59:59", 0.0, 6.85, 113501, 112, "ミサト", 24, 0.0, 1, 2, 24014, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, "2030/12/17 14:59:59", 0.0, 3.0, 113501, 113, "ミサト", 24, 0.0, 1, 2, 24015, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, "2030/12/17 14:59:59", 0.0, 6.11, 192401, 611, "ダイチ", 24, 0.0, 1, 2, 24016, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, "2030/12/17 14:59:59", 0.0, 6.75, 192401, 612, "ダイチ", 24, 0.0, 1, 2, 24017, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 192401, 613, "ダイチ", 24, 0.0, 2, 2, 24018, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, "2030/12/17 14:59:59", 0.0, 4.52, 113401, 211, "ハツネ", 24, 0.0, 2, 1, 24019, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, "2030/12/17 14:59:59", 0.0, 3.89, 113401, 212, "ハツネ", 24, 0.0, 2, 1, 24020, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, "2030/12/17 14:59:59", 0.0, 13.49, 113401, 213, "ハツネ", 24, 0.0, 1, 2, 24021, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, "2030/12/17 14:59:59", 0.0, 3.17, 106501, 311, "カヤ", 24, 0.0, 1, 2, 24022, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, "2030/12/17 14:59:59", 0.0, 4.42, 106501, 312, "カヤ", 24, 0.0, 1, 2, 24023, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, "2030/12/17 14:59:59", 0.0, 2.89, 106501, 313, "カヤ", 24, 0.0, 6, 1, 24024, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, "2030/12/17 14:59:59", 0.0, 3.71, 102301, 421, "アヤネ", 24, 0.0, 4, 3, 24025, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046, "2030/12/17 14:59:59", 0.0, 5.1, 192201, 721, "アサヒ", 24, 0.0, 2, 1, 24026, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, "2030/12/17 14:59:59", 0.0, 4.34, 192301, 821, "部員３", 24, 0.0, 1, 3, 24027, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("いい勝負だったよ\nまたやろうね", 10046, "2030/12/17 14:59:59", 0.0, 0.0, 192501, 521, "", 24, 0.0, 1, 1, 24028, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, "2030/12/17 14:59:59", -360.0, 5.62, 113501, 101, "ミサト", 24, 0.0, 1, 2, 24029, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, "2030/12/17 14:59:59", -360.0, 9.58, 113501, 102, "ミサト", 24, 0.0, 1, 2, 24030, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, "2030/12/17 14:59:59", -360.0, 0.0, 113501, 103, "ミサト", 24, 0.0, 2, 2, 24031, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, "2030/12/17 14:59:59", -360.0, 9.13, 113501, 104, "ミサト", 24, 0.0, 2, 1, 24032, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, "2030/12/17 14:59:59", -360.0, 8.27, 113501, 105, "ミサト", 24, 0.0, 1, 2, 24033, "2020/07/31 12:00:00");
